export class ProjectCard {
        title: string;
        description: string;
        yt_link: string;
        route:string;

        constructor(title: string,description: string,yt_link: string,route:string){
                this.title=title,
                this.description=description
                this.yt_link=yt_link,
                this.route=route
        }
}
